  return (
    <ul className="list">
      <Link style={navStyle} to="/about">
        <li>About</li>
      </Link>
      <Link style={navStyle} to="/shop">
        <li>Tech</li>
      </Link>
      <Link style={navStyle} to="/shop">
        <li>Projects</li>
